ベイツPolice Shoesシリーズの超軽量ミドルカットシューズです。<br><br>

軽量化する為ナイロンをベースに構成されており、負荷のかかる部分はレザーとラバー素材で補強されてたシューズです。<br><br>

・機能/特徴<br>
革/ナイロン・アッパー<br>
吸湿、防菌加工　AurerightR中敷<br>
EVA ミッドソール<br>
対磨耗に優れたゴム製のアウトソール<br>
セメント製法<br><br>

・品番/カラー<br>
5130/ブラック<br>
5133/コヨーテブラウン<br>
5132/フォリッジグリーン<br>
5131/デザート<br><br>

・ヒールの高さ：約4cm（地面からかかとまでの計測です）<br>
・履き口までの高さ：約8cm（インソールから一番高い部分までの計測です）<br>
・重量：片足約375g（サイズ：8EW）<br>
・原産国：中国<br><br>

・サイズ目安<br>
6M（24.5cm～25cm）<br>
7EW（25.5cm～26cm）<br>
8EW（26.5cm～27cm）<br>
9EW（27.5cm～28cm）<br>
10EW（28.5cm～29cm）<br><br>

