ベイツ社独自のユニークなインナークッションシステム ”ICS” を搭載した「ツヤ」のある牛革製のオックスフォードシューズです。<br><br>

このI.C.S.（インディビジュアル コンフォートシステム）はインソールの下に装着されているジェルディスクを回転させ、”クッション／傾き”調整をする事が可能で、個人の足の癖や歩行パターンに合わせたセッティング幅をもたせた画期的なシステムです。<br><br>

・重量：約380g（右足 サイズ８）<br>
・製法：セメント製法<br>
・原産国：中国<br>
・ヒールの高さ：約3cm（地面からかかとまでの計測です）<br>
・履き口までの高さ：約7cm（インソールから一番高い部分までの計測です）<br><br>

・サイズ目安<br>
7EW（25.5cm～26cm）<br>
8EW（26.5cm～27cm）<br>
9EW（27.5cm～28cm）<br>
10EW（28.5cm～29cm）<br><br>

☆ディスクポジションの種類と機能<br>
ディスクを回転させ、F.C.O.I.それぞれのポジションに合わせて使用します。（クッション／傾き調整）<br><br>

・Firm zone：ディスクを「F」のポジションにセットすることで、着地時の衝撃を効果的に利用し、推進力反発力を高め歩行時のスムーズな体重移動を助けます。(エナジーリターン)<br><br>

・Cushion zone：ディスクを「C」のポジションにセットすることで、着地時の衝撃吸収力を高めます。(クッション)<br><br>

・Outward zone：ディスクを「O」のポジションにセットすることで、外側への足の傾きを防ぎ、自然で安定した歩行を助けます。(サビネーション)<br> <br> 

・Inward zone：ディスクを「I」のポジションにセットすることで、内側への足の傾きを防ぎ、自然で安定した歩行を助けます。(プロネーション)<br> 
注意：ディスクを正常位置からズレた状態のまま着用すると、ディスク破損の原因になります。<br> <br> 

